$(document).ready(function () {

   


   

    function showSelectDivisionNums(data_image) {
        $(".positions_counter__wrapper")[0].innerHTML = '';
        var division = eval("divisions." + data_image);
        x = division.count;
        var numbs = ("" + division.count).split("");
        if (numbs.length == 1) {
            $(".positions_counter__wrapper").append('<div class=""><img src="../files/theme-lilium/images/numbers/number_0.png" title="" alt="four"></div>');
        }
        $.each(numbs, function (indexInArray, valueOfElement) {
            $(".positions_counter__wrapper").append('<div><img src="../files/theme-lilium/images/numbers/number_' + valueOfElement + '.png" title="" alt="four"></div>');
        });
    }

    function showDivisionNums(data_image) {
        var division = eval("divisions." + data_image);
        if (data_image == "alldivisions") {
            let total = 0;
            Object.entries(divisions).forEach(([key, value]) => {
                total += value.count;
            });
            $(".positions-count").text(total);
        } else {
            $(".positions-count").text(division?.count);
        }

    }




    $(document).mouseup(function (e) {
        var container = $('nav, .mobile-trigger');

        if (!container.is(e.target) && container.has(e.target).length === 0) {
            $('nav').removeClass('open');
            $('.mobile-trigger').removeClass('close');
            $('#header').removeClass('header--nav-open');
            $('header #logo source').attr('srcset', $('header #logo img').data('original')).fadeIn(500);
        }
    });





    /* If the user clicks anywhere outside the select box,
    then close all select boxes: */
   // document.addEventListener("click", closeAllSelect);
    //customSelects();


    // initMobileCareersSearch();
}); // DOM Ready

$(window).on('load', function (event) {

    $('body #header:not(.scrolled)').delay(100).animate({
        top: '0px',
        opacity: 1
    }, 600, 'easeInOutCubic', function () {
    })



    $('body').removeClass('fade');
    var simpleParallaxImage = document.getElementsByClassName('simpleParallaxImage');
    if (simpleParallaxImage.length !== 0) {
        new simpleParallax(simpleParallaxImage, {
            transition: 'none',
            scale: 1.2
        });
    }


});


