function fixIsotopeHeights() {
    var gridColumns = 3;
    if (window.innerWidth < 768) {
        gridColumns = 2
    }
    if (window.innerWidth < 576) {
        gridColumns = 1
    }
    setTimeout(() => {
        highestInRow = "0";
        itemCounter = 0;
        rowElements = [];
        visibleElements = [];
        $(".mod_newslist .grid .layout_latest").each(function (index, element) {
            if ($(element).css("display") == "block") {
                $(element).css("height", "auto");
                visibleElements.push(element);
            }
        });
        $(visibleElements).each(function (index, element) {
            rowElements.push(element)
            if ((index + 1) % gridColumns == 0) {
                $(rowElements).each(function (index, element) {
                    element.dataset.col = index + 1;
                    if ($(element).css("height") > highestInRow) {
                        highestInRow = $(element).css("height");
                    }
                });
                $(rowElements).each(function (index, element) {
                    $(element).css("height", highestInRow);
                });
                rowElements = [];
                highestInRow = "0";
            }
        });
    }, 700);
}

